interface StartProps {
    start: boolean;

}
const StartMenu = (props : StartProps) => {
    return (
        <>
            <h1>Game</h1>
            <button 
                onClick={() => startButton()} 
                value={props.start ? 'start' : 'stop'}></button>
        </>
    );
};

export default StartMenu;
